DROP DATABASE Hshop2023;
CREATE DATABASE Hshop2023;
USE Hshop2023;


SET @@SQL_MODE = 'ANSI';


CREATE TABLE  ChiTietHD (
    MaCT INT AUTO_INCREMENT PRIMARY KEY,
    MaHD INT NOT NULL,
    MaHH INT NOT NULL,
    DonGia FLOAT NOT NULL,
    SoLuong INT NOT NULL,
    GiamGia FLOAT NOT NULL
);

CREATE TABLE HangHoa (
    MaHH INT AUTO_INCREMENT PRIMARY KEY,
    TenHH CHAR(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
    TenAlias CHAR(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL,
    MaLoai INT NOT NULL,
    MoTaDonVi CHAR(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL,
    DonGia FLOAT NULL,
    Hinh CHAR(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL,
    NgaySX DATETIME NOT NULL,
    GiamGia FLOAT NOT NULL,
    SoLanXem INT NOT NULL,
    MoTa TEXT CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NULL,
    MaNCC CHAR(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL
);

CREATE VIEW vChiTietHoaDon AS
    SELECT cthd.*, TenHH
    FROM  ChiTietHD cthd
    JOIN HangHoa hh ON hh.MaHH = cthd.MaHH;

CREATE TABLE BanBe (
    MaBB INT AUTO_INCREMENT PRIMARY KEY,
    MaKH CHAR(20) NULL,
    MaHH INT NOT NULL,
    HoTen CHAR(50) NULL,
    Email CHAR(50) NOT NULL,
    NgayGui DATETIME NOT NULL,
    GhiChu TEXT NULL
);

CREATE TABLE ChuDe (
    MaCD INT AUTO_INCREMENT PRIMARY KEY,
    TenCD CHAR(50) NULL,
    MaNV CHAR(50) NULL
);

CREATE TABLE GopY (
    MaGY CHAR(50) PRIMARY KEY NOT NULL,
    MaCD INT NOT NULL,
    NoiDung TEXT NOT NULL,
    NgayGY DATE NOT NULL,
    HoTen CHAR(50) NULL,
    Email CHAR(50) NULL,
    DienThoai CHAR(50) NULL,
    CanTraLoi TINYINT(1) NOT NULL,
    TraLoi CHAR(50) NULL,
    NgayTL DATE NULL
);

CREATE TABLE HoaDon (
    MaHD INT AUTO_INCREMENT PRIMARY KEY,
    MaKH CHAR(20) NOT NULL,
    NgayDat DATETIME NOT NULL,
    NgayCan DATETIME NULL,
    NgayGiao DATETIME NULL,
    HoTen CHAR(50) NULL,
    DiaChi CHAR(60) NOT NULL,
    CachThanhToan CHAR(50) NOT NULL,
    CachVanChuyen CHAR(50) NOT NULL,
    PhiVanChuyen FLOAT NOT NULL,
    MaTrangThai INT NOT NULL,
    MaNV CHAR(50) NULL,
    GhiChu CHAR(50) NULL
);

CREATE TABLE HoiDap (
    MaHD INT NOT NULL,
    CauHoi CHAR(50) NOT NULL,
    TraLoi CHAR(50) NOT NULL,
    NgayDua DATE NOT NULL,
    MaNV CHAR(50) NOT NULL,
    PRIMARY KEY (MaHD)
);

CREATE TABLE KhachHang (
    MaKH CHAR(20) NOT NULL,
    MatKhau CHAR(50) NULL,
    HoTen CHAR(50) NOT NULL,
    GioiTinh TINYINT(1) NOT NULL,
    NgaySinh DATETIME NOT NULL,
    DiaChi CHAR(60) NULL,
    DienThoai CHAR(24) NULL,
    Email CHAR(50) NOT NULL,
    Hinh CHAR(50) NULL,
    HieuLuc TINYINT(1) NOT NULL,
    VaiTro INT NOT NULL,
    RandomKey CHAR(50) NULL,
    PRIMARY KEY (MaKH)
);

CREATE TABLE Loai (
    MaLoai INT AUTO_INCREMENT PRIMARY KEY,
    TenLoai CHAR(50) NOT NULL,
    TenLoaiAlias CHAR(50) NULL,
    MoTa TEXT NULL,
    Hinh CHAR(50) NULL
);
CREATE TABLE NhaCungCap (
    MaNCC CHAR(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
    TenCongTy CHAR(50) NOT NULL,
    Logo CHAR(50) NOT NULL,
    NguoiLienLac CHAR(50) NULL,
    Email CHAR(50) NOT NULL,
    DienThoai CHAR(50) NULL,
    DiaChi CHAR(50) NULL,
    MoTa TEXT NULL,
    PRIMARY KEY (MaNCC)
);

CREATE TABLE NhanVien (
    MaNV CHAR(50) NOT NULL,
    HoTen CHAR(50) NOT NULL,
    Email CHAR(50) NOT NULL,
    MatKhau CHAR(50) NULL,
    PRIMARY KEY (MaNV)
);

CREATE TABLE PhanCong (
    MaPC INT AUTO_INCREMENT NOT NULL,
    MaNV CHAR(50) NOT NULL,
    MaPB CHAR(7) NOT NULL,
    NgayPC DATETIME NULL,
    HieuLuc BIT NULL,
    PRIMARY KEY (MaPC)
);

CREATE TABLE PhanQuyen (
    MaPQ INT AUTO_INCREMENT NOT NULL,
    MaPB CHAR(7) NULL,
    MaTrang INT NULL,
    Them BIT NOT NULL,
    Sua BIT NOT NULL,
    Xoa BIT NOT NULL,
    Xem BIT NOT NULL,
    PRIMARY KEY (MaPQ)
);

CREATE TABLE PhongBan (
    MaPB CHAR(7) NOT NULL,
    TenPB CHAR(50) NOT NULL,
    ThongTin TEXT NULL,
    PRIMARY KEY (MaPB)
);

CREATE TABLE TrangThai (
    MaTrangThai INT NOT NULL,
    TenTrangThai CHAR(50) NOT NULL,
    MoTa VARCHAR(500) NULL,
    PRIMARY KEY (MaTrangThai)
);
CREATE TABLE TrangWeb (
    MaTrang INT AUTO_INCREMENT NOT NULL,
    TenTrang VARCHAR(50) NOT NULL,
    URL VARCHAR(250) NOT NULL,
    PRIMARY KEY (MaTrang)
);

CREATE TABLE YeuThich (
    MaYT INT AUTO_INCREMENT NOT NULL,
    MaHH INT NULL,
    MaKH VARCHAR(20) NULL,
    NgayChon DATETIME NULL,
    MoTa VARCHAR(255) NULL,
    PRIMARY KEY (MaYT)
);

